styles:
.lifestyle__wrap {
	overflow: initial;
}
.lifestyle__wrap:before {
	content: " ";
	position: absolute;
	top: -50px;
	right: 0;
	display: block;
	width: 200px;
	height: 200px;
	background: url('https://assets.foreo.com/files/static/2020-04/leaf.png') no-repeat;
	background-size: 100%;
}
.lifestyle:after {
	content: " ";
	position: absolute;
	bottom: 0;
	right: 0;
	display: block;
	width: 100%;
	height: 20px;
	background: url('https://assets.foreo.com/files/static/2020-04/rectangle.png') no-repeat;
	background-size: 100% 100%;
	z-index: 2;
}
@media only screen and (min-width: 768px) {
	.lifestyle__picture {
		padding-top: 100px;
	}
}
